        const bankArea = document.getElementById("bank-area");
        const url = new URL(window.location.href);
        const timeIt = url.searchParams.get("timeIt");
        const money = url.searchParams.get("money");
       
        const receiveUser = url.searchParams.get("receiveUser");
        const receiveAccout = url.searchParams.get("receiveAccout");
        const receiveBank = url.searchParams.get("receiveBank");
        const yourNameBank = url.searchParams.get("yourNameBank");
        const yourAccoutBank = url.searchParams.get("yourAccoutBank");
        const content = url.searchParams.get("content");
        const timeBank = url.searchParams.get("timeBank");
        const dateBank = url.searchParams.get("dateBank");
        const typeBank = url.searchParams.get("typeBank");
        const tradingCode = url.searchParams.get("tradingCode");
        
        const pin = url.searchParams.get("pin");
        const wifi = url.searchParams.get("wifi");
        const sim1 = url.searchParams.get("sim1");
        const sim2 = url.searchParams.get("sim2");
        const data = url.searchParams.get("data");

        const bankCountTextDom = document.getElementById("bank-count-text");
        const contentBank = `${content}`;
        bankCountTextDom.innerHTML = contentBank;

        const bankCountTextDom1 = document.getElementById("bank-count-text1");
        const contentBank1 = `${receiveBank}`;

        const wifiSVG = getWifi(wifi);
        const sim1SVG = getSim(sim1);
